import React, { useMemo } from "react";
import TableCell from "../TableCell";

const TableRow = ({ data }) => {
   const cells = data.map((cellData, index)=><TableCell key={index} value={cellData.value}/>);
   return <tr>{cells}</tr>;
};

export default TableRow;
